define('Deprecated/Controls/Button/Demo/Buttons/Buttons', [
   'SBIS3.CONTROLS/Utils/InformationPopupManager',
   'Lib/Control/CompoundControl/CompoundControl',
   'html!Deprecated/Controls/Button/Demo/Buttons/Buttons',
   'Deprecated/Controls/Button/Button',
   'Deprecated/Controls/PushButton/PushButton',
   'Deprecated/Controls/LinkButton/LinkButton',
   'Deprecated/Controls/Menu/Menu'
], function(
   InformPopManager,
   CompoundControl,
   dotTplFn
) {
   /**
    * Deprecated/Controls/Button/Demo/Buttons/Buttons
    * @class Deprecated/Controls/Button/Demo/Buttons/Buttons
    * @extends Lib/Control/CompoundControl/CompoundControl
    * @control
    */
   var moduleClass = CompoundControl.extend(/** @lends Deprecated/Controls/Button/Demo/Buttons/Buttons.prototype */{
      _dotTplFn: dotTplFn,
      $protected: {
         _options: {
            
         }
      },
      $constructor: function() {
      },

      init: function() {
         moduleClass.superclass.init.call(this);
         this.getChildControlByName("Button 1").subscribe("onActivated", function(){
            InformPopManager.showConfirmDialog({
               message: "Вы действительно хотите выйти?"
            });
         });         
      }
   });
   return moduleClass;
});